CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_AddCommodity` (IN `inCommodityID` VARCHAR(50), IN `inCommodityName` VARCHAR(50), IN `inManufacturer` VARCHAR(1000), IN `inSpecification` VARCHAR(50), IN `inRetailPrice` FLOAT(8), IN `inDiscount` FLOAT(4), IN `inCosting` FLOAT(8))  BEGIN

	DECLARE f float(8);
	SET @f=inDiscount*inRetailPrice;
		tbl_commodity.ID,
		tbl_commodity.CommodityID,
		tbl_commodity.CommodityName,
		tbl_commodity.Manufacturer,
		tbl_commodity.Specification,
		tbl_commodity.RetailPrice,
		tbl_commodity.Discount,
		tbl_commodity.FinalPrice,
		tbl_commodity.Costing)
VALUES(inCommodityID,inCommodityName,
inManufacturer,inSpecification,inRetailPrice,inDiscount,
@f,inCosting
);
END$$

