CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_AddPlaceUserRefer` (IN `inGroupID` VARCHAR(255), IN `inUserID` VARCHAR(255))  BEGIN
	DELETE FROM tbl_place_user where tbl_place_user.PlaceID = inGroupID and tbl_place_user.UserID = inUserID;
	SELECT tbl_user.Role into @role from tbl_user where tbl_user.ID = inUserID;
	IF
		@role = 0
		THEN
			VALUES (inGroupID, inUserID, (SELECT tbl_member_info.Photo FROM tbl_member_info WHERE tbl_member_info.ID = inUserID));

		ELSEIF
		@role = 2
		THEN
			VALUES (inGroupID, inUserID, (SELECT tbl_employee_info.Photo FROM tbl_employee_info WHERE tbl_employee_info.ID = inUserID));	

	END IF;

END$$

