CREATE DEFINER=`sq_hongxibao1`@`localhost` PROCEDURE `proc_commitOrder` (IN `inUserID` VARCHAR(255), IN `inGroupID` VARCHAR(255), IN `inAmount` VARCHAR(255))  BEGIN
	SELECT  tbl_place.State into @groupstate from tbl_place where tbl_place.PlaceID = inGroupID;
	IF
		@groupstate = 2
	THEN
		SELECT '团购已结束' GroupState;
	ELSEIF
		@groupstate = 0
	THEN
		SELECT '团购未开始' GroupState;
	ELSE
		set @orderid = NULL;
		SELECT tbl_order.OrderID into @orderid from tbl_order where tbl_order.UserID = inUserID and tbl_order.PlaceID = inGroupID;
		IF @orderid is NULL
		THEN
			VALUES (CURRENT_TIMESTAMP(),inUserID,(SELECT tbl_place.CommodityID from tbl_place where tbl_place.PlaceID = inGroupID),inAmount,inGroupID);
		ELSE
			update tbl_order set tbl_order.Amount = tbl_order.Amount+inAmount where tbl_order.OrderID = @orderid;
		END IF;
     		SELECT '下单成功' success;
	END IF;
END$$

