CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_GenerateGroup` (IN `inGroupID` VARCHAR(10))  BEGIN
	
 
	select tbl_place.PlaceID,tbl_place.QRcode,
	SEC_TO_TIME(tbl_place.PlanTimeLenght) as Timeleft,
	tbl_place.State,
	tbl_place.CommodityID,
	tbl_place.UserNum,
	tbl_place.SaleNum,
	tbl_commodity.CommodityName,
	tbl_commodity.RetailPrice FinalPrice,
	tbl_commodity.ID as CommodityUUID,
	(SELECT GROUP_CONCAT(tbl_album.albumPath) from tbl_album where tbl_album.pid = tbl_commodity.ID) as Albums,
	tbl_place.GiftID
	from tbl_place LEFT JOIN tbl_commodity on tbl_place.CommodityID = tbl_commodity.CommodityID   where tbl_place.PlaceID = inGroupID;

END$$

CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_GenerateOrder` (IN `inUserID` VARCHAR(255), IN `inCommodityID` VARCHAR(255), IN `inAmount` INT, IN `inPlaceID` VARCHAR(255))  BEGIN
	SELECT  tbl_place.State into @groupstate from tbl_place where tbl_place.PlaceID = inPlaceID;
	IF
		@groupstate = 2
	THEN
		SELECT '团购已结束' GroupState;
	ELSEIF
		@groupstate = 0
	THEN
		SELECT '团购未开始' GroupState;
	ELSE
		VALUES (CURRENT_TIMESTAMP(),inUserID,inCommodityID,inAmount,inPlaceID);
		SELECT LAST_INSERT_ID() as LastInsertID;
	END IF;
	
END$$

