CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_GetGroupLive` (IN `inGroupID` VARCHAR(255))  BEGIN

	SELECT  IFNULL(SUM(tbl_order.Amount),0) into @TotalAmount FROM tbl_order WHERE tbl_order.PlaceID = inGroupID;
	SELECT tbl_place.CommodityID into @CommodityID FROM tbl_place WHERE tbl_place.PlaceID = inGroupID ;
	SELECT  tbl_commodity.RetailPrice,tbl_commodity.GroupMinPrice into @RetailPrice,@GroupMinPrice
  from tbl_commodity
	WHERE tbl_commodity.CommodityID = @CommodityID;


  SELECT tbl_place.MinPriceNeedNum into @MinPriceNeedNum from tbl_place WHERE tbl_place.PlaceID = inGroupID;
	
	IF @TotalAmount >= @MinPriceNeedNum
	THEN
		SET @FinalPrice = @GroupMinPrice;
	ELSEIF @MinPriceNeedNum = 0
	THEN
	  SET @FinalPrice = @GroupMinPrice;
   ELSEIF @TotalAmount = 0
	THEN
	  SET @FinalPrice = @RetailPrice;
	ELSEIF @TotalAmount  = 1
		THEN
			SET @FinalPrice = @RetailPrice - (@RetailPrice - @GroupMinPrice)*10/100;
	ELSEIF @TotalAmount  = 2
		THEN
			SET @FinalPrice = @RetailPrice - (@RetailPrice - @GroupMinPrice)*18/100;
	ELSEIF @TotalAmount  = 3
		THEN
			SET @FinalPrice = @RetailPrice - (@RetailPrice - @GroupMinPrice)*24/100;
	ELSEIF @TotalAmount  = 4
		THEN
			SET @FinalPrice = @RetailPrice - (@RetailPrice - @GroupMinPrice)*28/100;
	ELSEIF @TotalAmount  = 5
		THEN
			SET @FinalPrice = @RetailPrice - (@RetailPrice - @GroupMinPrice)*30/100;
	ELSE
			SET @FinalPrice = @RetailPrice - (@RetailPrice - @GroupMinPrice)*30/100 - (@TotalAmount-5)*((@RetailPrice - @GroupMinPrice) -(@RetailPrice - @GroupMinPrice)*30/100)/(@MinPriceNeedNum-5);
	END IF;
	SET @FinalPrice = CONVERT(@FinalPrice,decimal(10,2));
	UPDATE tbl_place_commodity set tbl_place_commodity.FinalPrice = @FinalPrice where tbl_place_commodity.CommodityID = @CommodityID and tbl_place_commodity.PlaceID = inGroupID;
	SELECT @TotalAmount as TotalAmount, @FinalPrice as FinalPrice;
END$$

CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_GetGroupUserList` (IN `inGroupID` VARCHAR(255), IN `inFirstReq` VARCHAR(10))  BEGIN
	IF 
		inFirstReq = 'true'
	THEN
	SELECT * from tbl_place_user where tbl_place_user.PlaceID = inGroupID ;	
	ELSE
		SELECT GROUP_CONCAT(UserID) into @ids from tbl_place_user where tbl_place_user.PlaceID = inGroupID ;
		SELECT tbl_place.UserID into @lastids from tbl_place where tbl_place.PlaceID = inGroupID;
		SET @compare = STRCMP(@ids,@lastids);
		IF
		@compare = 0
			THEN 
				SELECT 'nochange' as state;
			ELSE
				UPDATE tbl_place set tbl_place.UserID = @ids where tbl_place.PlaceID = inGroupID;
				SELECT * from tbl_place_user where tbl_place_user.PlaceID = inGroupID ;	
		END IF;
	END IF;
END$$

