CREATE DEFINER=`sq_hongxibao1`@`localhost` PROCEDURE `proc_updateGroupState` (IN `inGroupID` VARCHAR(200))  BEGIN
	
  SELECT  IFNULL(SUM(tbl_order.Amount),0) into @TotalAmount FROM tbl_order WHERE tbl_order.PlaceID = inGroupID;
	SELECT tbl_place.CommodityID into @CommodityID FROM tbl_place WHERE tbl_place.PlaceID = inGroupID ;
	SELECT  tbl_commodity.RetailPrice,tbl_commodity.GroupMinPrice into @RetailPrice,@GroupMinPrice
  from tbl_commodity
	WHERE tbl_commodity.CommodityID = @CommodityID;


  SELECT tbl_place.MinPriceNeedNum into @MinPriceNeedNum from tbl_place WHERE tbl_place.PlaceID = inGroupID;
	
	IF @TotalAmount >= @MinPriceNeedNum
	THEN
		SET @FinalPrice = @GroupMinPrice;
	ELSEIF @MinPriceNeedNum = 0
	THEN
	  SET @FinalPrice = @GroupMinPrice;
	ELSE
	  SET @FinalPrice = @GroupMinPrice + (@MinPriceNeedNum - @TotalAmount)*(@RetailPrice - @GroupMinPrice)/(@MinPriceNeedNum-0);
	END IF;
	SET @FinalPrice = CONVERT(@FinalPrice,decimal(10,2));
	UPDATE tbl_place_commodity set tbl_place_commodity.FinalPrice = @FinalPrice where tbl_place_commodity.CommodityID = @CommodityID and tbl_place_commodity.PlaceID = inGroupID;
	update tbl_place set tbl_place.State = 2, tbl_place.SaleNum =  @TotalAmount where tbl_place.PlaceID = inGroupID;
END$$

CREATE DEFINER=`sq_hongxibao1`@`%` PROCEDURE `proc_UpdateOrder` (IN `inOrderID` VARCHAR(255), IN `inAmount` INT)  BEGIN
	SELECT tbl_order.UserID, tbl_order.PlaceID into @inUserID,  @inPlaceID from tbl_order where tbl_order.OrderID = inOrderID;
	SELECT  tbl_place.State into @groupstate from tbl_place where tbl_place.PlaceID = @inPlaceID;
	IF
		@groupstate = 2
	THEN
		SELECT '团购已结束' GroupState;
	ELSEIF
		@groupstate = 0
	THEN
		SELECT '团购未开始' GroupState;
	ELSE
		update tbl_order set tbl_order.Amount = inAmount where tbl_order.OrderID = inOrderID;
		SELECT '更新订单成功' success; 
	END IF;
END$$

