DELIMITER ;

CREATE TABLE `tbl_admin` (
  `ID` int(10) UNSIGNED NOT NULL COMMENT '用户ID, 由系统自动分配',
  `Phone` varchar(255) NOT NULL COMMENT '用户EMAIL，作为登陆用',
  `Password` varchar(255) NOT NULL,
  `Role` int(10) UNSIGNED NOT NULL COMMENT '用户角色，对应角色表'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户表';


CREATE TABLE `tbl_album` (
  `id` int(10) UNSIGNED NOT NULL,
  `pid` int(10) UNSIGNED NOT NULL,
  `albumPath` varchar(50) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE `tbl_commodity` (
  `ID` int(10) NOT NULL,
  `CommodityID` varchar(50) NOT NULL DEFAULT '0' COMMENT '商品编号',
  `CommodityName` varchar(50) NOT NULL COMMENT '商品名称',
  `Manufacturer` varchar(1000) NOT NULL COMMENT '生产厂商',
  `Specification` varchar(50) NOT NULL COMMENT '商品规格',
  `RetailPrice` decimal(10,2) NOT NULL COMMENT '商品零售价',
  `Discount` float(4,0) NOT NULL DEFAULT '0' COMMENT '商品折扣',
  `FinalPrice` decimal(10,2) NOT NULL COMMENT '最终售价',
  `Costing` decimal(10,2) NOT NULL COMMENT '成本价',
  `GroupMinPrice` decimal(10,2) DEFAULT NULL COMMENT '团购最低价'
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE `tbl_dealer_info` (
  `ID` int(10) UNSIGNED NOT NULL COMMENT '序号',
  `DealerID` varchar(50) NOT NULL COMMENT '经销商编号',
  `DealerName` varchar(50) NOT NULL COMMENT '经销商姓名',
  `SharingPercentage` float(4,0) NOT NULL COMMENT '分成比例',
  `Principal` varchar(50) NOT NULL COMMENT '负责人',
  `Phone` varchar(255) NOT NULL COMMENT '电话',
  `QQ` varchar(50) NOT NULL COMMENT 'QQ号'
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE `tbl_employee_info` (
  `ID` int(10) NOT NULL,
  `Number` int(20) NOT NULL,
  `Photo` varchar(200) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE `tbl_gift` (
  `ID` int(10) UNSIGNED NOT NULL COMMENT '礼品编号',
  `GiftName` varchar(50) NOT NULL COMMENT '礼品名称',
  `GiftPrice` decimal(10,2) NOT NULL COMMENT '礼物单价',
  `GiftLevel` int(2) NOT NULL COMMENT '礼品等级',
  `ActivationPercent` float(4,0) NOT NULL COMMENT '礼品激活百分比',
